import './App.css';
import React from 'react'


/////////////////////////////////////////////////////// M-ui
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(5),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Navbar: {
    padding: theme.spacing(8),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Footer: {
    padding: theme.spacing(8),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperL: {
    padding: theme.spacing(8),
    height: 800 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperR: {
    padding: theme.spacing(8),
    height: 800 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }
}));


function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Paper className={classes.Navbar}>xs=12</Paper>
          </Grid>
          <Grid item xs={3}>
          <Paper className={classes.PaperR}>xs=3</Paper>
          </Grid>
          <Grid item xs={9}>
            <Paper className={classes.PaperL}>xs=6</Paper>
          </Grid>
          <Grid item xs={12}>
            <Paper className={classes.Footer}>xs=12</Paper>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default App;
